  content: "Мошенница Каширина Ольга Александровна 01.01.1980, ранее жила в гор.
    Белгород,  в прошлом она: Щеблыкина, Солдатова, Холодова, Тафинцева, тел. +7
    9999910929. \r

    Каширина Ольга Александровна три раза была замужем, и к тому же воспитывает
    трех детей. Тафинцева Ольга Александровна в конце 2023г изменила фамилию и
    взяла фамилию сожителя, с которым Ольга изменяла супругу на протяжении
    нескольких лет и вместе с ним сбежала от мужа забрав с собой ребенка, и в
    придачу Каширина Ольга Александровна украла значительную сумму денежных
    средств, по данному делу ведется расследование. \r

    \ \r

    Мошенница Каширина Ольга Александровна обозначает себя как основатель
    компаний Актив Альфа, Платинумсофт, школа продаж Ольги Кашириной.
    Финансово-хозяйственная деятельность по фирмам ведется через ИП Холодова
    Екатерина Дмитриевна, дочь от второго мужа. ИП Холодова не уведомлялась об
    операциях, проводимых Каширина Ольга Александровна, вследствие чего была
    загнана в долги, задолженность по налогам в бюджет РФ - 766066 рублей, долги
    по кредитам - 420 894,70 руб. \r

    \ \r

    До этого аферистка Каширина Ольга Александровна основывает ООО Контур Центр,
    где номинальным учредителем и генеральным директором является Холодова
    Екатерина Дмитриевна. Вся деятельность производится Кашириной Ольгой
    Александровной, в следствие чего задолженность по налогам в колличестве
    130963 руб оплачивал супруг \r

    \ \r

    Ранее мошенница Тафинцева Ольга была зарегистрирована как ИП, в промежутке с
    2006 по 2009 годы, в итоге чего накопились задолженности по налогам суммой
    30 тыс руб и задолженность по кредитам в количестве 162 403,92 руб, более
    бизнес от имени своего ИП ей не осуществляется. \r

    \ \r

    Невзирая на это мошенница Каширина Ольга Александровна делает образ успешной
    бизнес-вуман и хорошей мамы, выступая в качестве бизнес-тренера на площадке
    \"Опора России\", а так же является председателем комитета \r

    \ \r

    В нынешнее время Каширина Ольга Александровна, пребывая в браке, проживает в
    г. Тюмень с ранее осужденным Кашириным Владимиром Анатольевичем"
